import React, {useState} from "react";


function Playlist() {

    const playlistArray = [];

    function tester() {
        console.log('Hello world!');
    }


    const arrayPlaylistItems = playlistArray.map(song=>
        <li key={song.title}>
            <p>{song.title}</p>
            <p>{song.artist}</p>
            <p>{song.album}</p>
            <button 
                type='button'
                /*onClick={removeFromPlaylist}*/
            >-</button>
        </li>
    )


    return(
        <>
            <h2>Playlist</h2>
            <ul>
                {arrayPlaylistItems}
            </ul>
            <button type="button">Save to Spotify</button>
        </>

    )
}

export default Playlist;
